import React from 'react';
import Body from '../Body';
import Footer from '../Footer';
import Sidebar from '../Sidebar';
import "./style.css";

const Player = () => {
    return (
        <div>
        <div className='player'>
            <Sidebar></Sidebar>
            <Body></Body>
        </div>
        <div className="footer">
            <Footer></Footer>
        </div>
        </div>
    );
};

export default Player;
